import React, { useContext, useEffect } from 'react';
import { useState } from 'react';
import './style.css';
import { FaSearch, FaCircle, FaCamera, FaImage, FaCogs, FaQuestion, FaPaperPlane } from 'react-icons/fa';
import { UserContext } from '../context/Usercontext';
import { useNavigate } from 'react-router-dom';
import  axios  from 'axios';

function Home() {
    const [search, setSearch] = useState('');
    const { logout } = useContext(UserContext);
    const navigate = useNavigate();
    const [chatList, setChatList] = useState([]);

    useEffect(() => {
        // Function to fetch chat list from the API
        const fetchChatList = async () => {
            try {
                const response = await axios.get('http://127.0.0.1:8000/api/list_chat/', {
                    headers: {
                        Authorization: `Bearer ${localStorage.getItem('access_token')}` // Gửi access token để xác thực người dùng
                    }
                });
                setChatList(response.data);
            } catch (error) {
                console.error('Error fetching chat list:', error);
            }
        };

        // Call the function to fetch chat list
        fetchChatList();
    }, []);

    const handleLogout = () => {
        logout();
        navigate("/");
    };

    return (
        <div className="container">
            <div className="row clearfix">
                <div className="col-lg-12">
                    <div className="card chat-app">
                        <div id="plist" className="people-list">
                            <div className="input-group">
                                <div className="input-group-prepend">
                                    <span className="input-group-text"><FaSearch /></span>
                                </div>
                                <input type="text" className="form-control" placeholder="Search..." />
                            </div>
                            <ul className="list-unstyled chat-list mt-2 mb-0">
                                {chatList.map(chat => (
                                    <li className="clearfix" key={chat.id}>
                                        {/* Render chat information */}
                                        <img src="https://bootdey.com/img/Content/avatar/avatar1.png" alt="avatar" />
                                        <div className="about">
                                            <div className="name">{chat.room_name}</div>
                                            <div className="status">
                                                <FaCircle className={chat.status === 1 ? 'online' : 'offline'} /> {chat.status === 1 ? 'online' : `offline since ${chat.created_at}`}
                                            </div>
                                        </div>
                                    </li>
                                ))}
                            </ul>
                        </div>
                        <div className="chat">
                            <div className="chat-header clearfix">
                                <div className="row">
                                    <div className="col-lg-6">
                                        <a href="#" data-toggle="modal" data-target="#view_info">
                                            <img src="https://bootdey.com/img/Content/avatar/avatar2.png" alt="avatar" />
                                        </a>
                                        <div className="chat-about">
                                            <h6 className="m-b-0">Aiden Chavez</h6>
                                            <small>Last seen: 2 hours ago</small>
                                        </div>
                                    </div>
                                    <div className="col-lg-6 hidden-sm text-right">
                                        <button className="btn btn-outline-secondary" ><FaCamera /></button>
                                        <button className="btn btn-outline-primary"><FaImage /></button>
                                        <button className="btn btn-outline-info"><FaCogs /></button>
                                        <button className="btn btn-outline-warning"><FaQuestion /></button>
                                        <button className="btn btn-outline-warning" onClick={handleLogout}>< FaPaperPlane  />Logout</button>
                                        
                                    </div>
                                </div>
                            </div>
                            <div className="chat-history">
                                <ul className="m-b-0">
                                    <li className="clearfix">
                                        <div className="message-data text-right">
                                            <span className="message-data-time">10:10 AM, Today</span>
                                            <img src="https://bootdey.com/img/Content/avatar/avatar7.png" alt="avatar" />
                                        </div>
                                        <div className="message other-message float-right"> Hi Aiden, how are you? How is the project coming along? </div>
                                    </li>
                                    <li className="clearfix">
                                        <div className="message-data">
                                            <span className="message-data-time">10:12 AM, Today</span>
                                        </div>
                                        <div className="message my-message">Are we meeting today?</div>
                                    </li>
                                    <li className="clearfix">
                                        <div className="message-data">
                                            <span className="message-data-time">10:15 AM, Today</span>
                                        </div>
                                        <div className="message my-message">Project has been already finished and I have results to show you.</div>
                                    </li>
                                </ul>
                            </div>
                            <div className="chat-message clearfix">
                                <div className="input-group mb-0">
                                    <div className="input-group-prepend">
                                        <span className="input-group-text"><FaPaperPlane /></span>
                                    </div>
                                    <input type="text" className="form-control" placeholder="Enter text here..." />
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Home;
